import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './core/Home';

function Routing() {
  return (
    <BrowserRouter>
    <Routes>
        <Route path="/" exact element={<Home/>} />


    </Routes>

    </BrowserRouter>
  )
}

export default Routing;
